import React, { Component } from 'react'
import { Link } from 'react-router-dom'
import { withRouter } from 'react-router-dom'

class Home extends Component {


    render () {
        return(<>
            <h1>Cat/Dog Memes!</h1>
            <Link to="/choosecat">
                <button>I love Cats More</button>
            </Link>

            <Link to="/choosedog">
            <img src={`https://res.cloudinary.com/alienora/image/upload/v1593796817/dog_wdcca1.png`}></img>
                {/* <button>I love Dogs More</button> */}
                </Link>


            <img src={`https://res.cloudinary.com/alienora/image/upload/v1593795750/cat_png_owqiym.png`}></img>


        </>)
    }
}

export default withRouter(Home)
